  const compartida = useContext(PruebaContext);

  const{usuario, setUsuario}=useContext(PruebaContext);

  return (
    <div>
      <h1>Inicio</h1>
      <p>Pagina de inicio</p>
      <p>Nombre: {usuario.nombre}</p>
      {/* <p>Valor compartido <strong>{compartida.contenid}</strong></p> */}
    </div>
  )
}
